import './App.css';
import Home from '../src/components/Home';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
function App() {
  return (
   <>  
   <BrowserRouter>
   <Routes>
    <Route path='home' element={<Home />} />
   </Routes>
   </BrowserRouter>

</>
  );
}

export default App;
